Here's a possible implementation of the `sortStrings` function:
```
function sortStrings(strings) {
  return strings.sort((a, b) => a.localeCompare(b));
}
```
This function takes an array of strings as input and returns a sorted copy of the array in alphabetical order. The `sort` method is used to sort the array, and the comparison function `localeCompare` is used to compare the strings based on their lexicographical ordering.

Note that this implementation assumes that the strings are in the same language and use the same writing system (e.g., English or Spanish). If you need to handle strings from different languages or writing systems, you may want to use a more sophisticated comparison function, such as `Intl.Collator`.
